import {useEffect} from "react";

function UserCard(){


    useEffect(
        function(){
            $.ajax({
  url: 'https://randomuser.me/api/',
  dataType: 'json',
  success: function(data) {
    console.log(data);
  }
});
      
        }
    )

    return "loading"; 
}

export default UserCard;
